{
[75141001] = {id = 75141001, remark = "横暴だよーっ。悪い人を捕まえた側が、監獄城に\n入れられるなんて聞いてないよー！　ひどいよーっ！！", type = 1, option_ids = "0", next = 75141002, role_ids = "75201001", expression = "exp_angry", action = "angry", role_type = 75201001, position = "418:606:10050", role_admission_type = "75201001:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007, effect_sound = 0, dialogue_sound = "April_Plot_927"}
