[75141005] = {id = 75141005, remark = "残念だが、もうここに来た以上、\n何をしても逃れられない。…一生な。", type = 1, option_ids = "0", next = -1, role_ids = "75205006", expression = "exp_said", action = "angry", role_type = 75205006, position = "418:606:10050", role_admission_type = "75205006:0:0", role_departure_type = "75201003:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007, effect_sound = 0, dialogue_sound = "MB_Anemone_Plot_12"}
, 
[75141101] = {id = 75141101, remark = "お待ちしておりました、皆様。\nようこそ、監獄城へ！", type = 1, option_ids = "0", next = 75141102, role_ids = "75204014", action = "happy", role_type = 75204014, position = "418:606:10050", role_admission_type = "75204014:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "ME_Emil_Plot_1"}
, 
[75141102] = {id = 75141102, remark = "私は監獄城の城主であり看守長の\nエミールと申します、どうぞお見知りおきを！", type = 1, option_ids = "0", next = 75141103, role_ids = "75204014", action = "happy", role_type = 75204014, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "ME_Emil_Plot_2"}
