[75141104] = {id = 75141104, remark = "うんうん、元気があって大変よろしい♪\nさて、新入りの皆様にはいろいろ説明しましょう。", type = 1, option_ids = "0", next = 75141105, role_ids = "75204014", action = "happy", role_type = 75204014, position = "418:606:10050", role_admission_type = "75204014:0:0", role_departure_type = "75201004:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "ME_Emil_Plot_3"}
, 
[75141105] = {id = 75141105, remark = "…説明なんていらない。\n本で読んだことがある。", type = 1, option_ids = "0", next = 75141106, role_ids = "75201003", expression = "exp_angry", action = "angry", role_type = 75201003, position = "418:606:10050", role_admission_type = "75201003:0:0", role_departure_type = "75204014:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "francesca_Plot_535"}
, 
[75141106] = {id = 75141106, remark = "『監獄城』…ありとあらゆる国の重罪人を\n集めた、巨大な城…", type = 1, option_ids = "0", next = 75141107, role_ids = "75201003", expression = "exp_angry", action = "0", role_type = 75201003, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "francesca_Plot_536"}
, 
[75141107] = {id = 75141107, remark = "数百年の歴史があり、収監されたらおしまい。\nその後、外に出れた者は…誰ひとりとしていない。", type = 1, option_ids = "0", next = 75141108, role_ids = "75201003", expression = "exp_said", action = "0", role_type = 75201003, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "francesca_Plot_537"}
, 
[75141108] = {id = 75141108, remark = "おお、素晴らしい！\nなんと博識な囚人でしょう！", type = 1, option_ids = "0", next = 75141109, role_ids = "75204014", action = "shock", role_type = 75204014, position = "418:606:10050", role_admission_type = "75204014:0:0", role_departure_type = "75201003:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "ME_Emil_Plot_4"}
