[75141110] = {id = 75141110, remark = "もちろん、最大限の賛辞ですとも。", type = 1, option_ids = "0", next = 75141111, role_ids = "75204014", action = "happy", role_type = 75204014, position = "418:606:10050", role_admission_type = "75204014:0:0", role_departure_type = "75201003:0:0,75201005:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "ME_Emil_Plot_5"}
, 
[75141111] = {id = 75141111, remark = "では、あとは実際に慣れれば、ということで…\nこちらの小部屋にお入りくださーい♪", type = 1, option_ids = "0", next = -1, role_ids = "75204014", action = "happy", role_type = 75204014, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "ME_Emil_Plot_6"}
, 
