, 
[75141209] = {id = 75141209, remark = "まぁ…噂で聞いたことがあるわ。\n百発百中の、天才的な占い師だって。", type = 1, option_ids = "0", next = 75141210, role_ids = "75201005", expression = "exp_shock", action = "shock", role_type = 75201005, position = "418:606:10050", role_admission_type = "75201005:0:0", role_departure_type = "75201014:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "Shanon_Plot_484"}
