[75141210] = {id = 75141210, remark = "…でも、ここにいるってことは\n何か罪を犯してる…？", type = 1, option_ids = "0", next = 75141211, role_ids = "75201005:75201003", expression = "0:exp_shock", action = "0:shock", role_type = 75201003, position = "195:606:10000,642:606:10050", role_admission_type = "75201003:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "francesca_Plot_540"}
