[75141212] = {id = 75141212, remark = "にしても…ワタシの占いの腕も落ちたかなぁ。\nキミのことは、見逃してたんだよね", type = 1, option_ids = "0", next = 75141213, role_ids = "75201014", expression = "exp_siad", action = "siad", role_type = 75201014, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "Quinn_Plot_7"}
